def rm_123(A):
	if len(A) == 0: return 1
	for a in set(A):
		if set([a,a+1,a+2]) <= set(A):
			A1 = A[:]
			for i in range(3): A1.remove(a+i)
			return judge(A1)

def rm_111(A):
	if len(A) == 0: return 1
	for a in set(A):
		if A.count(a) >= 3:
			A1 = A[:]
			for i in range(3): A1.remove(a)
			return judge(A1)

def judge(A):
	return rm_123(A) or rm_111(A)

